const initialState= {
    signin: 0
}

function signOutReducer (state=initialState, action) {
    switch (action.type) {
        case 'SIGN_OUT': 
        return Object.assign({}, state, {
            signin: {
                    result: action.result}
        })
        default:
            return state
    }
    }

export default signOutReducer
